  input: '"TEXT","F3XA","","In its letter dated Jan. 22, 2003, the FEC requested additional
    information about the Democratic Party Committee Abroad''s (DPCA) administrative
    expenses. DPCA is a political party committee that represents the interests of
    American citizens living abroad. DPCA currently maintains only one part-time staff
    member and utilizes office space currently occupied by the Democratic National
    Committee, an affiliated national party committee. Accordingly, the ASDC''s administrative
    expenses are of a limited nature.  Needless to say, all operating expenses of
    the ASDC are paid for in accordance with 11 C.F.R. S 106.5.  Furthermore, ASDC
    has chosen to utilize the federal/non-federal ratio mandated for national party
    committees, which for 2002 is 60percent federal/40percent non-federal. (From Nov.
    5, 2002, onward, DPCA pays its operating expenses in 100-percent federal money,
    in accordance with the BCRA restrictions on national parties raising or spending
    non-federal funds.) In its letter the FEC also noted that our report discloses
    $2,059.00 in transfers from the non-federal account for joint activity, but $0
    as the non-federal share of joint activity for the reporting period. This amended
    report accurately reflects expenditures that were made as joint activity but originally
    incorrectly reported as Other Federal Operating Expenditures (Line 21 (b)) .The
    FEC also advised that DPCA should submit one Schedule H with Section D completed.
    DPCA has used the Section A (Fixed Federal Percentage) allocation method due to
